'isi' => '<p>Berdasarkan Keputusan Menteri Pendayagunaan Aparatur Negara dan Reformasi Birokrasi (MenPANRB) Republik Indonesia Nomor 583 Tahun 2019 tanggal 29 September 2019 tentang Penetapan Kebutuhan Pegawai Aparatur Sipil Negara di Lingkungan Pemerintah Kabupaten Wonosobo Tahun Anggaran 2019, maka Pemerintah Kabupaten Wonosobo akan melaksanakan seleksi penerimaan CPNS Tahun Anggaran 2019 sejumlah 321 formasi umum dan 6 formasi disabilitas dengan pengelompokan rincian sebagai berikut :</p>

<p>A.&nbsp;Tenaga Pendidik Total : 166 formasi</p>

<p>B. Tenaga Kesehatan Total : 85 formasi</p>

<p>C. Tenaga Teknis Lainnya/ Infrastruktur Total : 76 formasi</p>

<p>Informasi Persyaratan Umum dan Persyaratan Khusus, Tatacara Pendaftaran, Pelaksanaan Ujian/ Seleksi serta rincian masing-masing pengelompokkan formasi jabatan, kualifikasi pendidikan, jumlah/ kuota formasi dan unit kerja penempatan diinformasikan melalui portal&nbsp;<a href="https://sscasn.bkn.go.id/" target="_blank">SSCASN Badan Kepegawaian Negara</a>,&nbsp;<a href="https://bkd.wonosobokab.go.id/" target="_blank">BKD Wonosobo</a>, dan&nbsp;<a href="https://cpns.wonosobokab.go.id/" target="_blank">CPNS Kabupaten Wonosobo</a>.</p>',
